//medium.com/@caglarcansarikaya" target="_blank" rel="noopener noreferrer">Medium blog</a></strong> and <strong><a href="https://www.youtube.com/@caglarcansarikaya" target="_blank" rel="noopener noreferrer">YouTube channel</a></strong>.`},s1={title:"About Me",paragraphs:[{id:1,content:"I'm Çağlar. I graduated from a mid-level university in computer engineering, with a pretty average GPA. During my studies, I had the chance to join the Erasmus internship program, which gave me the opportunity to work abroad and experience a different culture. In 2020, I started my professional life as a junior full stack developer. For the first time, I found myself dedicating almost ten hours a day to work and its responsibilities. It was the first time work felt like a true obligation, not just something I did for fun."},{id:2,content:"My university years were full of free time and social activities. Back then, seeing friends and making plans was easy. But once I started working, keeping in touch became much harder. Even seeing my friends once or twice a week now feels rare and special. After work, daily routines like eating, sleeping, and chores leave very little time for personal growth or learning new things. This made me realize how precious time really is."},{id:3,content:"Early on, I thought personal growth was only about achieving more or working harder. Over time, I learned that it’s much more about understanding myself and what actually makes me happy. I explored everything from coding and mindfulness to psychology. Like most people, I sometimes miss the freedom and energy of my university years. Back then, there was plenty of time and enthusiasm, but not much money. Now, in my thirties, things have flipped: I might have a bit more money and experience, but much less free time and more responsibilities. That feeling of missing the past is normal, but I’ve learned to appreciate every stage of life for what it is."},{id:4,content:"It’s easy to complain about losing touch with friends, but everyone’s life changes after university. We all have different jobs, some of us are married, some have kids, and responsibilities pile up. The truth is, good things are special because they are tied to a certain time in life. Even things that used to be simple, like organizing a game or meeting up, can become difficult as schedules fill up. When friends do manage to reconnect, it often does not happen as often as anyone hopes. This is a common part of growing older. While it is natural to look back and miss the past, focusing on what is good in the present can make a big difference."},{id:5,content:"One thing I’ve been learning is how much our thoughts and feelings are shaped by our brains and hormones—especially dopamine and serotonin. Even major events or stress can change the way we feel and behave by affecting our brain chemistry. Stress, in particular, is a double-edged sword. Our desires and goals create stress, which pushes us to act. If we make progress, stress often turns into satisfaction. But if we only imagine and never act, it can lead to frustration. Our brains want to avoid stress, but a certain amount of it is necessary to motivate us. If we set goals that are too big or unrealistic, our brains might try to protect us by pushing us toward easier, more pleasurable activities, making it even harder to stick with what we started. This is why willpower isn’t always enough. Sometimes you win, sometimes you don’t, and that’s part of being human."},{id:6,content:"I’ve started to really understand the advice to 'set small goals.' Taking small steps each day matters. If you miss a day, it’s not a disaster—just try again tomorrow. And if something feels impossible for a long time, maybe it’s not what you truly want. Ultimately, our brains are always trying to maximize rewards with minimum effort. Understanding how our thoughts and feelings are connected to our biology makes it easier to accept ourselves and the choices we make. Stress is harmful in excess, but it’s also necessary for growth and progress. Life is complex, and every phase brings its own challenges and rewards."},{id:7,content:'I’m not a psychologist, but I’ve learned a lot about myself and how I feel. <strong>"Now I focus on what I can change and try not to lose sight of the present moment. I’ve taken lessons from the past, but I know it is already behind me."</strong> Or maybe I’m just telling myself what I want to hear.'}]},o1={title:"My Projects",items:[{id:1,title:"Web Page Tester",description:"A powerful and efficient ai builded web page testing tool that analyzes website response times and detects errors. This tool helps website administrators and developers identify performance bottlenecks and problematic URLs across their websites.",tech:["C#",".NET"],github:"https://github.com/caglarsarikaya/PageTester",demoLink:null},{id:2,title:"Tightrope Walker Game",description:"The Tightrope Walker Game is a browser-based 3D game implemented using JavaScript and WebGL via the Three.js library. The game features a character who must traverse a tightrope stretched between two mountains while maintaining balance.",tech:["JavaScript","HTML","CSS","React","Three.js","Vite.js"],github:"https://github.com/caglarsarikaya/TightropeWalker",demoLink:"https://caglarsarikaya.github.io/TightropeWalker/"}]},r1={title:"Content & Media",youtubeChannelUrl:"https://youtube.com/@caglarcansarikaya",mediumProfileUrl:"https://caglarcansarikaya.medium.com"},d1={contact:{title:"Contact",email:"caglarcansarikaya@gmail.com"},social:{title:"Connect",links:[{platform:"GitHub",url:"https://github.com/caglarsarikaya",icon:"FaGithub"},{platform:"LinkedIn",url:"https://linkedin.com/in/caglarcansarikaya",icon:"FaLinkedin"},{platform:"YouTube",url:"https://youtube.com/@caglarcansarikaya",icon:"FaYoutube"},{platform:"Medium",url:"https://caglarcansarikaya.medium.com",icon:"FaMedium"}]},copyright:"Caglar Sarikaya. All rights reserved."},h1=[{id:"mcCIym5CuFQ",isShort:!0,title:"How